    default:'default',
    dark:'dark'
} 

export const alertProps = {
    vertical:{
        top:'top',
        bottom:'bottom',
    },
    horizontal:{
        left:'left',
        right:'right',
        center:'center'
    },
    severity:{
        success:'success',
        error:'error',
        warning:'warning',
        info:'info',
    }
}

